import React from "react";
import { NavLink } from "react-router-dom";
import { Button, Image } from "semantic-ui-react";

export default function clubKampanyalari() {
  return (
    <div>
      <Button.Group inverted size="huge" widths="3">
        <Button inverted color="red" as={NavLink} to="/tumkampanyalar">
          TÜM KAMPANYALAR
        </Button>
        <Button inverted color="red" as={NavLink} to="/birliktealkampanyalari">
          BİRLİKTE AL FIRSATLARI
        </Button>
        <Button inverted color="red" as={NavLink} to="/clubkampanyalari">
          CLUB KAMPANYALARI
        </Button>
      </Button.Group>
      <br />
      <br />
      <Image src="images/family2.PNG" size="massive" centered />
      <Image src="images/kampanyabitti.PNG" size="massive" centered />

    </div>
  );
}
